'use client';
'use strict';

var jsxRuntime = require('react/jsx-runtime');
var index = require('../List/index.js');
var Link = require('../Link/Link.js');

const ErrorSummaryItem = ({ href, asChild, children, ...rest }) => {
    return (jsxRuntime.jsx(index.List.Item, { ...rest, children: jsxRuntime.jsx(Link.Link, { href: href, asChild: asChild, children: children }) }));
};
ErrorSummaryItem.displayName = 'ErrorSummaryItem';

exports.ErrorSummaryItem = ErrorSummaryItem;
